import "./Header.css";
import Logo from "../../assets/logo.png";

const Header = () => {
  return (
    <div className="header">
      <img src={Logo} alt="Logo" className="logo"></img>
      <ul className="header-menu">
        <li>Home</li>
        <li>Programs</li>
        <li>Why us</li>
        <li>Plans</li>
        <li>Testimonials</li>
      </ul>
      <div id="mobile">
        <i className="fas fa-bars"></i>
        <i className=""></i>
      </div>
    </div>
  );
};

export default Header;
